properties.property:
local Serial = require "actions/Serial"
local Do = require "actions/Do"
local MessageBox = require "actions/MessageBox"
local Animate = require "actions/Animate"
local Wait = require "actions/Wait"
local Ease = require "actions/Ease"
local BlockPlayer = require "actions/BlockPlayer"

return function(self)
    if GameState:isFlagSet("sonic_staybehind") then
        return Serial {
            MessageBox{message="Sally: Sorry Sonic, but I've made up my mind.", blocking = true},
            Do(function()
                self:refreshKeyHint()
            end)
        }
    end

    return BlockPlayer {
        Do(function()
            self.scene.player.noIdle = true
        end),
        MessageBox {
            message = "Sonic: Whatcha doin' Sal?",
        },
        Animate(self.sprite, "binoculars_2"),
        MessageBox {
            message = "Sally: Trying to get a good look at Robotnik's coms tower...",
        },
        Animate(self.sprite, "binoculars_1"),
        Ease(self.scene.camPos, "x", -800, 0.3),
        Wait(1),
        MessageBox {
            message = "Sally: You see that skinny tower next to the Death Egg?",
        },
        MessageBox {
            message = "Sally: That will be our next target.",
        },
        Ease(self.scene.camPos, "x", 0, 0.3),
        MessageBox {
            message = "Sonic: Awfully close to Buttnik's lair. {p50}What's the plan?",
        },
        Animate(self.scene.player.sprite, "thinking"),
        MessageBox {
            message = "Sonic: Slam and jam? {p40}Smash and splash? {p40}Dump and--",
            closeAction = Wait(2)
        },
        Animate(self.sprite, "thinking"),
        MessageBox {
            message = "Sally: There will be no 'slamming', {p20}'jamming', {p20}'smashing', or {p20}'splashing'!"
        },
        MessageBox {
            message = "Sally: This will be a stealth mission. {p50}And after what happened at the Power Grid mission, I think you should stay back.",
        },
        Animate(self.scene.player.sprite, "idleright"),
        MessageBox {
            message = "Sonic: What! {p50}Come on Sal, you guys could use some muscle in the party.",
        },
        MessageBox {
            message = "Sally: That's why Bunnie will be joining Anotine and I.",
        },
        Animate(self.scene.player.sprite, "irritated"),
        MessageBox {
            message = "Sonic: Antoine's going, but I can't go?! {p50}Coooome oooon.",
        },
        Animate(self.scene.player.sprite, "irritated"),
        MessageBox {
            message = "Sally: You're staying here, Sonic Hedgehog! {p50}That's an order.",
        },
        Do(function()
            self:refreshKeyHint()
            self.scene.player.noIdle = false
            GameState:setFlag("sonic_staybehind")
        end)
    }
end
